import React from "react";
import "./App.css";
import MenuSwitch from "./components/MenuSwitch/MenuSwitch";
import { Provider } from "react-redux";
import store from "./store";

function App() {
  return (
    <Provider store={store}>
      <MenuSwitch />
    </Provider>
  );
}

export default App;
